import { React, useState } from 'react';
import '../css/MatchHistory.css';

/**
 * Match History Component
 * 
 * @author Ben Kelly w19014367
 */

export default function MatchHistory( contents ) {

    return(
            <div className='matchHistory-contents'>
                <p><strong>Date: </strong>contents.Date</p>
                <p><strong>Time: </strong>contents.Time</p>
                <p><strong>Venue: </strong>contents.Venue</p>
                <p><strong>Goals: </strong>contents.Goals</p>
                <p><strong>Assists: </strong>contents.Assists</p>
                <p><strong>Wellbeing: </strong>7</p>
                <p><strong>Fitness: </strong>6</p>
            </div>
    )

}
